  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II along its track during nineteen dives of the 2007 \"Operation
  Deep Scope\" expedition sponsored by the National Oceanic and Atmospheric Administration
  (NOAA) Office of Ocean Exploration, August 17 through 27, 2007. Measurements and
  information include sub's position, altitude, and depth; personnel assignments;
  dive, mission, and vehicle ID's; and sound velocity measurements. The Marine Operations
  Division of the Harbor Branch Oceanographic Institution provided the original submersible
  data.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
